import React from 'react';
import './Canvas.css';
import {connect} from 'react-redux';
import FreeDraw from 'free-draw';
function ConnectedCanvas() {

  return (
    <div className="Canvas">
      <FreeDraw></FreeDraw>
    </div>
  );
}
const Canvas = connect(null)(ConnectedCanvas);

export default Canvas;
